window.bookSummaryJSON = "<p>Having completed the first three temples and collected some of the gems needed to defeat the Evil Emperor, the Chosen One (aka the trolling player) and Qube (his ever-cheerful companion) must navigate the increasingly broken game world.<br> <br> New hurdles abound as the player wrestles with the fact that his companions might be sentient, Qube tries her hand at solo adventuring, and the rest of the party begin to awaken—and not all of them are happy about what they discover.<br> <br> Book two of a LitRPG/GameLit adventure about an NPC freed of its programming loop and brought along on a player's journey of adventure and power progression.<br> <br> About the series: Prophecy Approved Companion is a fun and often hilarious parody of old school games, Dungeons and Dragons, and every player who has ever thought “what happens if I do this?”</p> <p>An original take on life inside an RPG, from the perspective of a glitched NPC.</p>"; 
